// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from '.src/pages/HomePage';
import CreateKnowledgeHolder from '.src/pages/CreateKnowledgeHolder'; // Create this page
import ViewKnowledgeHolders from './pages/ViewKnowledgeHolders'; // Create this page

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/create-knowledge-holder" element={<CreateKnowledgeHolder />} />
        <Route path="/view-knowledge-holders" element={<ViewKnowledgeHolders />} />
      </Routes>
    </Router>
  );
};

export default App;
